import React, { Component } from 'react';
import './App.css';
import icon from './covid_icon.png';

export class App extends Component {
  async componentDidMount() {
    const data = await fetch('api/home');
    console.log(data)
  }

  render() {
    return (
      <div style={{ display: 'flex', backgroundColor: '#fff', flexDirection: 'column' }}>
        <div style={{ margin: 20 }}>
          <img style={{ height: 45 }} src={icon}/>
        </div>
        <h1>COVID-19 World Status</h1>
        <h3>Amidst the outbreak, we would like</h3>
        <header>
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
        </header>
      </div>
    );
  }
}
